&lt;p&gt;In the question two statements are given, followed by two conclusions, I and II. You have to consider the statements to be true even if it seems to be at variance from commonly known facts. You have to decide which of the given conclusions, if any, follows from the given statements.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Statement 1:&lt;/strong&gt; All clouds are fog.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Statement 2:&lt;/strong&gt; All fog are white.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Conclusion I:&lt;/strong&gt; Some white are clouds.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Conclusion II:&lt;/strong&gt; Some fog are clouds.&lt;/p&gt;

hn.value:
&lt;p&gt;दिए गए प्रश्न में दो कथन दो निष्कर्ष I तथा II के साथ दिए गए हैं। आपको कथन को सत्य मानना है यद्यपि वे ज्ञात तथ्यों से भिन्न प्रतीत होते हैं। आपको तय करना है कि कौन सा दिया गया निष्कर्ष, अगर कोई, दिए गए कथनों से निश्चित रूप से समझा जा सकता है।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;कथन 1:&lt;/strong&gt; सभी बादल कोहरे हैं।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;कथन 2:&lt;/strong&gt; सभी कोहरे सफेद होते हैं।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;निष्कर्ष I:&lt;/strong&gt; कुछ सफेद बादल हैं।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;निष्कर्ष II:&lt;/strong&gt; कुछ कोहरे बादल हैं।&lt;/p&gt;

